import React, { Component } from 'react'
import {Link} from 'react-router-dom'
import car_logo from '../logo.svg'
import styled from 'styled-components'
import {ButtonContainer} from './Button'
import SubmitButton from './SubmitButton'
import UserStore from './Stores/UserStore'

const NavItem = styled.div`
    margin-left: 30px;
    color: white;

    &:hover{
        cursor: pointer;
        transform: scale(1.1);
    }
`

const StyledLink = styled(Link)`
    text-decoration: none;
    &:focus, &:hover, &:visited, &:link, &:active {
        text-decoration: none;
    }
    &:hover {
        color: black;
    }
    color: white;
`

const NavButton = styled.div`
    position: absolute;
    right: 30px;
    color: white;
    border: 2px solid white;
    padding: 10px;
    border-radius: 10%;

    &:hover{
        cursor: pointer;
        background-color: white;
        &:hover {
            ${StyledLink} {
                color: black;
            }
        }

    }
`

export default class Navbar extends Component{
    logout = () => {
        UserStore.logout()
        this.props.history.push('/login');
        console.log(this.props);
    }

    renderLoggedInNav = () => {
        return (
            <NavWrapper className="nav-bar"> 
                <StyledLink to='/'>
                    <img src={car_logo} alt="store" className="nav-img"/>
                </StyledLink>
                <StyledLink to="/avaliableOffers">
                    <NavItem>Oferty</NavItem>
                </StyledLink>
                <StyledLink to="/add-offer">
                    <NavItem>Dodaj ofertę</NavItem>
                </StyledLink>
                <StyledLink to="/cars">
                    <NavItem>Moje samochody</NavItem>
                </StyledLink>
                <StyledLink to="/my-offer">
                    <NavItem>Moje akutalne wypożycznia</NavItem>
                </StyledLink>
                <StyledLink to="/messages">
                    <NavItem>Wiadomości</NavItem>
                </StyledLink>
                <NavButton>
                    <StyledLink onClick={this.logout} to="/login">
                        Wyloguj
                    </StyledLink>
                </NavButton>
            </NavWrapper>
        );
    }

    renderNotLoggedInNav = () => {
        return (
            <NavWrapper className="nav-bar"> 
                <Link to='/'>
                    <img src={car_logo} alt="store" className="nav-img"/>
                </Link>
                <NavButton>Zaloguj</NavButton>
            </NavWrapper>
        );
    }

    render(){
        if (this.props.userdata.isLoggedIn()) {
            return this.renderLoggedInNav();
        } else {
            return this.renderNotLoggedInNav();
        } 
